INSERT INTO [ontology] VALUES (372037,'HAO','1','0','Hymenoptera Anatomy Ontology','','http://obo.svn.sourceforge.net/viewvc/obo/ontologies/trunk/HAO/hao.obo','A structured controlled vocabulary of the anatomy of the Hymenoptera (bees, wasps, and ants).','5/19/2010 12:00:00 AM','Fri Aug 07 10:58:00 BST 2009')
