INSERT INTO [ontology] VALUES (373001,'LSM','1','0','Leukocyte Surface Markers','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/cell_type/cdo.obo','An ontology of CD markers for lymphocyte classification in the cell ontology, and other categories of surface and secreted proteins useful for discriminating between lymphocyte subsets by flow cytometry, ELISPOT, ELISA and other assays typically used for phenotypic identification of individual lymphocytes or lymphocyte populations have been included.','5/19/2010 12:00:00 AM','Mon Jul 07 08:40:13 BST 2008')
INSERT INTO [ontology] VALUES (373003,'FBsp','1','0','Fly taxonomy','','http://obo.cvs.sourceforge.net/obo/obo/ontology/taxonomy/fly_taxonomy.obo','The taxonomy of the family Drosophilidae (largely after Baechli) and of other taxa referred to in FlyBase.','5/19/2010 12:00:00 AM','Fri Apr 06 11:47:00 BST 2007')
INSERT INTO [ontology] VALUES (373005,'FIX','1','0','Physico-Chemical Methods and Properties','','http://obo.cvs.sourceforge.net/obo/obo/ontology/physicochemical/fix.obo','FIX consists of two ontologies: methods and properties (but not objects, which are subject of the chemical ontology). The methods are applied to study the properties.','5/19/2010 12:00:00 AM','Wed May 25 12:37:00 BST 2005')
INSERT INTO [ontology] VALUES (373007,'RO','1','0','Multiple Alignment','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/mao.obo','An ontology for data retrieval and exchange in the fields of multiple DNA/RNA alignment, protein sequence and protein structure alignment.','5/19/2010 12:00:00 AM','Mon Jan 31 08:22:00 GMT 2005')
INSERT INTO [ontology] VALUES (373008,'HP','1','0','Human phenotype ontology','','http://obo.cvs.sourceforge.net/*checkout*/obo/obo/ontology/phenotype/human_phenotype.obo','The Human Phenotype Ontology is being developed to provide a structured and controlled vocabulary for the phenotypic features encountered in human hereditary and other disease. Our goal is to provide resource for the computational analysis of the human phenome, with a current focus on monogenic diseases listed in the Online Mendelian Inheritance in Man (OMIM) database, for which annotations are also provided.','5/19/2010 12:00:00 AM','Tue Mar 09 12:12:00 GMT 2010')
INSERT INTO [ontology] VALUES (373011,'MFO','1','0','Medaka Fish Anatomy and Development','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/fish/medaka_ontology.obo','A structured controlled vocabulary of the anatomy and development of the Japanese medaka fish, Oryzias latipes.','5/19/2010 12:00:00 AM','Wed Aug 10 11:48:00 BST 2005')
INSERT INTO [ontology] VALUES (512001,'BFO','1','0','Basic Formal Ontology','','http://www.berkeleybop.org/ontologies/obo-all/bfo/bfo.obo','BFO is the upper level ontology upon which OBO Foundry ontologies are built.','9/14/2010 12:00:00 AM','Tue Sep 14 12:22:28 BST 2010')
INSERT INTO [ontology] VALUES (568004,'PW','1','0','Pathway Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/pathway.obo','The Pathway Ontology is a controlled vocabulary for pathways that provides standard terms for the annotation of gene products. The Pathway Ontology is under development at Rat Genome Database.','11/16/2010 12:00:00 AM','Fri Nov 12 17:21:00 GMT 2010')
INSERT INTO [ontology] VALUES (658001,'REX','1','0','Physico-Chemical Process','','http://obo.cvs.sourceforge.net/obo/obo/ontology/physicochemical/rex.obo','REX is an ontology of physico-chemical processes, i.e. physico-chemical changes occurring in course of time. REX includes both microscopic processes (involving molecular entities or subatomic particles) and macroscopic processes. Some biochemical processes from Gene Ontology (GO Biological process) can be described as instances of REX.','2/8/2011 12:00:00 AM','Fri Jan 05 09:19:00 GMT 2007')
INSERT INTO [ontology] VALUES (714002,'ENVO','1','0','Environmental Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/environmental/envo.obo','Ontology of environmental features and habitats.','3/25/2011 12:00:00 AM','Thu Mar 24 09:27:00 GMT 2011')
INSERT INTO [ontology] VALUES (781004,'FBbi','1','0','Biological Imaging Methods','http://www.flybase.org/cgi-bin/cvreport.html?id={0}','http://obo.cvs.sourceforge.net/obo/obo/ontology/experimental_conditions/imaging_methods/image.obo','A structured controlled vocabulary of sample preparation, visualization and imaging methods used in biomedical research.','5/25/2011 12:00:00 AM','Tue May 24 10:57:00 BST 2011')
INSERT INTO [ontology] VALUES (927001,'TGMA','1','0','Mosquito Gross Anatomy','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/mosquito_anatomy.obo','A structured controlled vocabulary of the anatomy of mosquitoes.','9/16/2011 12:00:00 AM','Wed Sep 14 23:44:00 BST 2011')
INSERT INTO [ontology] VALUES (972002,'MPATH','1','0','Mouse Pathology','http://eulep.anat.cam.ac.uk/Pathology_Ontology/MPATHsearch.php?search={0}','http://obo.cvs.sourceforge.net/obo/obo/ontology/phenotype/mouse_pathology/mouse_pathology.obo','A structured controlled vocabulary of mutant and transgenic mouse pathology phenotypes organised as instances of pathological processes.','10/27/2011 12:00:00 AM','Wed Oct 26 15:48:00 BST 2011')
INSERT INTO [ontology] VALUES (997002,'SYMP','1','0','Symptom Ontology','','http://gemina.svn.sourceforge.net/viewvc/gemina/trunk/Gemina/ontologies/gemina_symptom.obo','The symptom ontology was designed around the guiding concept of a symptom being: "A perceived change in function, sensation or appearance reported by a patient indicative of a disease".','11/18/2011 12:00:00 AM','Thu Nov 17 13:07:00 GMT 2011')
INSERT INTO [ontology] VALUES (1005001,'SPD','1','0','Spider Comparative Biology Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/spider/spider_comparative_biology.obo','Spider anatomy and biology ontology.','11/25/2011 12:00:00 AM','Fri Jul 08 13:00:00 BST 2011')
INSERT INTO [ontology] VALUES (1026005,'CL','1','0','Cell Type','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/cell_type/cell.obo','The Cell Ontology is designed as a structured controlled vocabulary for cell types. This ontology was constructed for use by the model organism and other bioinformatics databases, where there is a need for a controlled vocabulary of cell types. This ontology is not organism specific; indeed it includes cell types from prokaryotes to mammals, including plants and fungi. A full description of the Cell Ontology can be found in Bard, Rhee and Ashburner. 2005. An Ontology for Cell Types.','12/13/2011 12:00:00 AM','Wed Nov 09 14:35:00 GMT 2011')
INSERT INTO [ontology] VALUES (1027002,'CARO','1','0','Common Anatomy Reference Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/caro/caro.obo','The Common Anatomy Reference Ontology (CARO) is being developed to facilitate interoperability between existing anatomy ontologies for different species, and will provide a template for building new anatomy ontologies.','12/14/2011 12:00:00 AM','Mon Sep 12 09:18:00 BST 2011')
INSERT INTO [ontology] VALUES (1082002,'TAO','1','1','Teleost Anatomy and Development Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/fish/teleost_anatomy.obo','Multispecies fish anatomy ontology. Originally seeded from ZFA, but intended to cover terms relevant to other taxa.','2/2/2012 12:00:00 AM','Tue Feb 01 15:08:00 GMT 2011')
INSERT INTO [ontology] VALUES (1123001,'UO','1','1','Unit Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/phenotype/unit.obo','An ontology of standardized quantities to measure a physical quality.','3/8/2012 12:00:00 AM','Tue Feb 21 12:34:00 GMT 2012')
INSERT INTO [ontology] VALUES (1131001,'TADS','1','0','Tick Gross Anatomy','','http://www.anobase.org/anatomy/tick_anatomy.obo','The anatomy of the Tick, Families: Ixodidae, Argassidae','3/15/2012 12:00:00 AM','Tue Mar 13 15:35:00 GMT 2012')
INSERT INTO [ontology] VALUES (1154002,'FBcv','1','0','Flybase Controlled Vocabulary','','http://obo.cvs.sourceforge.net/obo/obo/ontology/vocabularies/flybase_controlled_vocabulary.obo','A structured controlled vocabulary used for various aspects of annotation by FlyBase. This ontology is maintained by FlyBase for various aspects of annotation not covered, or not yet covered, by other OBO ontologies. If and when community ontologies are available for the domains here covered FlyBase will use them.','4/4/2012 12:00:00 AM','Thu Mar 22 16:15:00 GMT 2012')
INSERT INTO [ontology] VALUES (1177001,'MOD','1','0','Protein Modifications (PSI-MOD)','','http://psidev.cvs.sourceforge.net/psidev/psi/mod/data/PSI-MOD.obo','A structured controlled vocabulary for the annotation of experiments concerned with protein modifications, both natural and artificial. Developed by the HUPO Proteomics Standards Initiative.','4/23/2012 12:00:00 AM','Mon Apr 23 00:59:00 BST 2012')
INSERT INTO [ontology] VALUES (1184005,'ECO','1','0','Evidence Codes','','http://obo.cvs.sourceforge.net/obo/obo/ontology/evidence_code.obo','A rich ontology for experimental and other evidence statements.','4/30/2012 12:00:00 AM','Sun Mar 25 23:17:00 BST 2012')
INSERT INTO [ontology] VALUES (1289002,'TTO','1','0','Teleost taxonomy','','http://obo.cvs.sourceforge.net/*checkout*/obo/obo/ontology/taxonomy/teleost_taxonomy.obo','The Teleost taxonomy ontology is being used to facilitate annotation of phenotypes, particularly for taxa that are not covered by NCBI because no submissions of molecular data have been made. Taxonomy ontologies can also be valuable in annotating legacy data, where authors make phenotype or ecological assertions (e.g., host-parasite associations) that refer to groups that are reorganized or no longer recognized.','7/20/2012 12:00:00 AM','Thu Jul 19 13:26:00 BST 2012')
INSERT INTO [ontology] VALUES (1371001,'GAZ','1','0','Gezetteer ontology','','http://obo.cvs.sourceforge.net/viewvc/obo/obo/ontology/environmental/gaz.obo','Gaz represents a first step towards an open source gazetteer, constructed on ontological principles, that describes places and place names and the relations between them.','9/30/2012 12:00:00 AM','Mon Apr 23 17:24:00 BST 2012')
INSERT INTO [ontology] VALUES (1374003,'CHEBI','1','0','Chemical Entities of Biological Interest','http://www.ebi.ac.uk/chebi/searchId.do?chebiId={0}','http://obo.cvs.sourceforge.net/obo/obo/ontology/chemical/chebi.obo','A structured classification of chemical compounds of biological relevance.','10/3/2012 12:00:00 AM','Thu Sep 27 15:06:00 BST 2012')
