INSERT INTO [ontology] VALUES (1449001,'HOM','1','0','Homology Ontology','','http://bgee.unil.ch/download/homology_ontology.obo','This ontology represents concepts related to homology, as well as other concepts used to describe similarity and non-homology.','12/7/2012 12:00:00 AM','Wed Dec 02 15:16:00 GMT 2009')
INSERT INTO [ontology] VALUES (1462001,'EDAM','1','0','EMBRACE Data and Methods','','http://edamontology.sourceforge.net/','EDAM is an ontology for bioinformatics tools and data.','12/18/2012 12:00:00 AM','Thu Dec 13 00:00:00 GMT 2012')
INSERT INTO [ontology] VALUES (1465002,'XAO','1','0','Xenopus anatomy and development','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/frog/xenopus_anatomy.obo','A structured controlled vocabulary of the anatomy and development of the African clawed frog (Xenopus laevis).','12/21/2012 12:00:00 AM','Tue Sep 18 22:24:00 BST 2012')
INSERT INTO [ontology] VALUES (1472003,'IMR','1','0','Molecule Role (INOH)','','http://obo.cvs.sourceforge.net/obo/obo/ontology/genomic-proteomic/molecule_role.obo','A structured controlled vocabulary of concrete protein names and generic (abstract) protein names. This ontology is a INOH pathway annotation ontology, one of a set of ontologies intended to be used in pathway data annotation to ease data integration. This ontology is used to annotate protein names, protein family names, generic/concrete protein names in the INOH pathway data.','12/27/2012 12:00:00 AM','Fri Mar 04 12:51:00 GMT 2011')
INSERT INTO [ontology] VALUES (1475004,'PO','1','0','Plant Ontology (Structure, Growth and Developmental Stage)','http://www.gramene.org/db/ontology/search_term?id={0}','http://obo.cvs.sourceforge.net/obo/obo/ontology/developmental/plant_development/plant/po_temporal.obo','A controlled vocabulary of plant growth and developmental stages as well as morphological and anatomical structures representing organs, tissues, cell types, and their biological relationships based on spatial and developmental organization.','12/30/2012 12:00:00 AM','Wed Jul 11 23:07:00 BST 2012')
INSERT INTO [ontology] VALUES (1482003,'EFO','1','1','ArrayExpress Experimental Factor Ontology','','http://www.ebi.ac.uk/microarray-as/aer/','An ontology of the parameters which are varied by the experimenter during the experiment. Experimental factors can relate to the sample, the treatment of the sample during the experiment (e.g., the protocols used) or some other methodological factor such as the equipment used.','1/5/2013 12:00:00 AM','Fri Jan 04 13:28:00 GMT 2013')
