INSERT INTO [ontology] VALUES (1515002,'WBPhenotype','1','0','C. elegans phenotype','','http://obo.cvs.sourceforge.net/*checkout*/obo/obo/ontology/phenotype/worm_phenotype.obo','A structured controlled vocabulary of Caenorhabditis elegans phenotypes','2/5/2013 12:00:00 AM','Sun Feb 03 09:36:00 GMT 2013')
INSERT INTO [ontology] VALUES (1522001,'TRANS','1','0','Pathogen transmission','','http://obo.cvs.sourceforge.net/*checkout*/obo/obo/ontology/phenotype/transmission_process.obo','This vocabulary describes a process that is the means of how a pathogen is transmitted from one host, reservoir, or source to another host. This transmission may occur either directly or indirectly and may involve animate vectors or inanimate vehicles','2/12/2013 12:00:00 AM','Wed Feb 06 14:52:00 GMT 2008')
INSERT INTO [ontology] VALUES (1535002,'TO','1','0','Cereal Plant Trait','http://www.gramene.org/db/ontology/search_term?id={0}','http://obo.cvs.sourceforge.net/obo/obo/ontology/phenotype/plant_traits/plant_trait.obo','A controlled vocabulary of describe phenotypic traits in cereal plants. Each trait is a distinguishable feature, characteristic, quality or phenotypic feature of a developing or mature cereal plant.','2/21/2013 12:00:00 AM','Tue Feb 19 12:41:00 GMT 2013')
INSERT INTO [ontology] VALUES (1543003,'SEP','1','1','Separation Methods','','http://code.google.com/p/gelml/source/browse/trunk/CV/sep.obo','A structured controlled vocabulary for the annotation of sample processing and separation techniques in scientific experiments, such as, and including, gel electrophoresis, column chromatography, capillary electrophoresis, centrifugation and so on. Developed jointly by the HUPO Proteomics Standards Initiative and The Metabolomics Standards Initiative.','2/27/2013 12:00:00 AM','Tue Feb 26 14:04:00 GMT 2013')
INSERT INTO [ontology] VALUES (1553001,'MI','1','0','Molecular Interaction (PSI MI 2.5)','','http://psidev.cvs.sourceforge.net/viewvc/psidev/psi/mi/rel25/data/psi-mi25.obo','A structured controlled vocabulary for the annotation of experiments concerned with protein-protein interactions. Developed by the HUPO Proteomics Standards Initiative.','3/7/2013 12:00:00 AM','Tue Mar 05 20:50:00 GMT 2013')
INSERT INTO [ontology] VALUES (1555003,'MIRO','1','0','Mosquito Insecticide Resistance','','http://obo.cvs.sourceforge.net/*checkout*/obo/obo/ontology/phenotype/mosquito_insecticide_resistance.obo','Application ontology for entities related to insecticide resistance in mosquitos','3/9/2013 12:00:00 AM','Sat Mar 09 06:41:04 GMT 2013')
INSERT INTO [ontology] VALUES (1559003,'BSPO','1','1','Spatial Reference Ontology','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/caro/spatial.obo','A general ontology of qualities as entities can be related to each other spatially.','3/12/2013 12:00:00 AM','Thu Sep 10 09:32:00 BST 2009')
INSERT INTO [ontology] VALUES (1560001,'MA','1','0','Mouse Adult Gross Anatomy','','http://obo.cvs.sourceforge.net/obo/obo/ontology/anatomy/gross_anatomy/animal_gross_anatomy/mouse/adult_mouse_anatomy.obo','A structured controlled vocabulary of the adult anatomy of the mouse (Mus).','3/13/2013 12:00:00 AM','Fri Feb 15 15:08:00 GMT 2013')
INSERT INTO [ontology] VALUES (1568001,'BTO','1','0','BRENDA tissue / enzyme source','','http://www.brenda-enzymes.info/ontology/tissue/tree/update/update_files/BrendaTissueOBO','A structured controlled vocabulary for the source of an enzyme. It comprises terms for tissues, cell lines, cell types and cell cultures from uni- and multicellular organisms.','3/20/2013 12:00:00 AM','Mon Dec 03 09:57:00 GMT 2012')
INSERT INTO [ontology] VALUES (1586001,'MS','1','1','PSI Mass Spectrometry Ontology','','https://code.google.com/p/psi-pi/source/browse/trunk/validator/trunk/src/main/resources/psi-ms.obo','HUPO Proteomics Standards Initiative Mass Spectrometry Standards Ontology that is to be used to annotate MzML instance documents.','4/6/2013 12:00:00 AM','Tue Mar 12 15:30:00 GMT 2013')
